Testing
Unit tests
Mocking
Some mocking is done automatically by
```
@inngest/test
```
, but can be overwritten if
needed.
All mocks detailed below can be specified either when creating an
```
InngestTestEngine
```
instance or for each individual execution:
Copy Copied
```
// Set the events for every execution
const t = new InngestTestEngine ({
function : helloWorld ,
// mocks here
});

// Or for just one, which will overwrite any current event mocks
t .execute ({
// mocks here
});

t .executeStep ( "my-step" , {
// mocks here
})
```
You can also clone an existing
```
InngestTestEngine
```
instance to encourage re-use
of complex mocks:
Copy Copied
```
// Make a direct clone, which includes any mocks
const otherT = t .clone ();

// Provide some more mocks in addition to any existing ones
const anotherT = t .clone ({
// mocks here
});
```
For simplicity, the following examples will show usage of
```
t.execute()
```
, but the
mocks can be placed in any of these locations.

Testing
Unit tests
Steps
Mocking steps can help you model different paths and situations within your
function. To do so, any step can be mocked by providing the
```
steps
```
option. You should always mock
```
sleep
```
and
```
waitForEvent
```
steps -
[learn more here](\docs\reference\testing#sleep-and-wait-for-event)
.
Here we mock two steps, one that will run successfully and another that will
model a failure and throw an error:
Copy Copied
```
t .execute ({
steps : [
{
id : "successful-step" ,
handler () {
return "We did it!" ;
} ,
} ,
{
id : "dangerous-step" ,
handler () {
throw new Error ( "Oh no!" );
} ,
} ,
] ,
});
```
These handlers will run lazily when they are found during a function's execution.
This means you can write complex mocks that respond to other information:
Copy Copied
```
let message = "" ;

t .execute ({
steps : [
{
id : "build-greeting" ,
handler () {
message = "Hello, " ;
return message;
} ,
} ,
{
id : "build-name" ,
handler () {
return message + " World!" ;
} ,
} ,
] ,
});
```

Testing
Unit tests
Sleep and waitForEvent
Steps that pause the function,
```
step.sleep
```
,
```
step.sleepUntil
```
, and
```
step.waitForEvent
```
should always be mocked.
step.sleep step.waitForEvent
Copy Copied
```
// Given the following function that sleeps
const myFunction = inngest .createFunction (
{ id : "my-function" } ,
{ event : "user.created" } ,
async ({ event , step }) => {
await step .sleep ( "one-day-delay" , "1d" );
return { message : "success" };
}
)
// Mock the step to execute a no-op handler to return immediately
t .execute ({
steps : [
{
id : "one-day-delay" ,
handler () {} , // no return value necessary
} ,
] ,
});
```

Testing
Unit tests
Custom
You can also provide your own custom mocks for the function input.
When instantiating a new
```
InngestTestEngine
```
or starting an execution, provide a
```
transformCtx
```
function that will add these mocks every time the function is
run:
Copy Copied
```
const t = new InngestTestEngine ({
function : helloWorld ,
transformCtx : (ctx) => {
return {
... ctx ,
event : someCustomThing ,
};
} ,
});
```
If you wish to still add the automatic mocking from
```
@inngest/test
```
(such as the
spies on
```
ctx.step.*
```
), you can import and use the automatic transforms as part
of your own:
Copy Copied
```
import { InngestTestEngine , mockCtx } from "@inngest/test" ;

const t = new InngestTestEngine ({
function : helloWorld ,
transformCtx : (ctx) => {
return {
... mockCtx (ctx) ,
event : someCustomThing ,
};
} ,
});
```
